import requests
import os

# 设置请求头，模拟游戏访问
headers = {
    'User-Agent': 'Rizline/6 CFNetwork/1408.0.4 Darwin/22.5.0',
    "X-Unity-Version": "2021.3.15f1c1"
}

for fileurl in downlist:

    # 设置要下载的文件的url
    url = fileurl

    # 发送GET请求，获取文件的响应内容
    response = requests.get(url, headers=headers)

    # 从响应头中获取文件名，如果没有则使用url中的文件名
    filename = response.headers.get('Content-Disposition')
    if filename:
        # 去掉引号和附加信息，只保留文件名
        filename = filename.split(';')[1].split('=')[1].strip('"')
    else:
        # 从url中截取文件名
        filename = os.path.basename(url)

    # 保存文件到本地，使用二进制写入模式
    with open(filename, 'wb') as f:
        f.write(response.content)

    # 打印文件名和大小
    print(f'文件{filename}已下载，大小为{os.path.getsize(filename)}字节。')